import React from 'react';
import { toPercentage, toDollar, toUnit } from '../../helper/formatter';
export default () => {
  const comparisonColdef = [
    {
      Header: 'Scenario',
      accessor: 'scenario',
      width: 50,
      align: 'left',
    },
    {
      Header: 'Sell Through %',
      accessor: 'Sell Through %',
      width: 50,
      align: 'left',
      Cell: (props) => <div> {toPercentage(props)} </div>,
    },
    {
      Header: 'Margin %',
      accessor: 'Margin %',
      Cell: (props) => <div> {toPercentage(props)} </div>,
    },
    {
      Header: 'AUR ($)',
      accessor: 'AUR ($)',
      Cell: (props) => <div> {toDollar(props)} </div>,
    },
    {
      Header: 'AUM ($)',
      accessor: 'AUM ($)',
      Cell: (props) => <div> {toDollar(props)} </div>,
    },
    {
      Header: 'MD Budget Utilises ($)',
      accessor: 'MD Budget Utilised($',
      Cell: (props) => <div> {toDollar(props)} </div>,
    },
    {
      Header: 'Left Over Inventory',
      accessor: 'Left Over Inventory',
      Cell: (props) => <div> {toUnit(props)} </div>,
    },
    {
      Header: 'Revenue ($)',
      accessor: 'Revenue ($)',
      Cell: (props) => <div> {toDollar(props)} </div>,
    },
    {
      Header: 'Margin ($)',
      accessor: 'Margin ($)',
      Cell: (props) => <div> {toDollar(props)} </div>,
    },
    {
      Header: 'Units',
      accessor: 'Units',
      Cell: (props) => <div> {toUnit(props)} </div>,
    },
  ];
  return comparisonColdef;
};
